script: |
  super -f text -I q3230.spq | sort > q3230.out

inputs:
  - name: q3230.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE ( + col1 * + col0 * col1 NOT BETWEEN ( + col1 ) AND col2 * + col2 * - col2 * + col0 / 66 * + col2 * col0 );
  - name: tab2

outputs:
  - name: q3230.out
    data: |
      46	51	23
      64	77	40
      75	67	58
